import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './footer.css';
import {Container, Row, Col} from 'react-bootstrap';
import { Twitter, Github } from 'react-bootstrap-icons';

class footer extends React.Component {
     render(){
          return(
          <div className='footer'>
               <Container>
               <Row>
                    <Col className='left'><div >Copyright &copy; 2021 Nile Google Developers Club, Abuja</div></Col>
                    <Col className='right'><div >Contact us  <span><Twitter color='white' /></span> <span>{Github}</span></div></Col>
               </Row>
               </Container>
              
          </div>
          )
     }
}
export default footer;
